import React from 'react';
import './index.css';

const Card = ({ props }) => {
    return (
        <div className='container tc bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5 '>
            <img className="card" alt='robots' src={`https://robohash.org/${props.id}?200x200`} />
            <div>
                <h2>{props.name}</h2>
                <p>{props.email}</p>
            </div>
        </div>
    );
}

export default Card;
